import React from "react";

import "./ChartBar.css";

function ChartBar(props) {
  return (
    <div>
      <div className="chart-bar">
        <div className="fill-height" style={`height: ${props.sum}%`}></div>
      </div>
      <span>{props.month}</span>
    </div>
  );
}

export default ChartBar;
